    // console.log(data.arr);
    return (
        <>
            <table>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>age</th>
                    </tr>
                </thead>
                {data.arr.map((item, i) => {
                    return <tr key={i}>
                        <td>{item.name}</td>
                        <td>{item.age}</td>
                    </tr>
                })}
            </table>

        </>
    )
}
export default InChild
